import { API_DOG } from "../constants/Api.constants";

class DogService{

    /*Esta funcion se puede hacer en el Main Component*/
    async getAllBreeds(){
        const response = await fetch(API_DOG.CHARACTER());
        return response.json();
    }
    async getBreedsById(id){
        const response = await fetch(API_DOG.CHARACTER_BY_ID(id));
        return response.json();
    }

}

export default new DogService();
